import { Link } from "react-router-dom";
export default function Product({ product }) {
  return (
    <td
    style={{
        width: "10%",
        padding: "10px",
        boxSizing: "border-box",
      }}
    >

      <Link to="/product/:id"><strong>{product.name}</strong> ({product.description}) </Link>

      <img
        src={product.imageUrl}
        alt={product.description}
        style={{
          display: "block",
          maxWidth: "100%",

        }}
      />



    </td>
  );
}
